function trans(char1) {
  let char_min = char1[0];
  let char_max = char1[0];

  for(let i = 0; i < char1.length; i++) {
      if(char1[i] < char_min) {
          char_min = char1[i]
      }
      if(char1[i] > char_max) {
          char_max = char1[i]
      }
  }
  for(let i = 0; i < char1.length; i++) {
      char1[i] = Math.floor(((char1[i]-char_min)/(char_max-char_min))*100);
  }
  return char1;
}

// 데이터를 내림차순하는 함수
function desc(sort, sort2, sort3, sort4) {
  for(let i =0; i < sort.length-1; i++) {
    for(j = i + 1; j < sort.length; j++) {
        if(sort[i] > sort[j]) {
            temp = sort[i]; // 큰 값을 잠시 임시변수에 저장
            sort[i] = sort[j]; // 작은 값을 앞으로 옮김
            sort[j] = temp; // 임시변수에 넣어둔 것을 뒤로 옮김

            temp = sort2[i]; // 큰 값을 잠시 임시변수에 저장
            sort2[i] = sort2[j]; // 작은 값을 앞으로 옮김
            sort2[j] = temp; // 임시변수에 넣어둔 것을 뒤로 옮김

            temp = sort3[i]; // 큰 값을 잠시 임시변수에 저장
            sort3[i] = sort3[j]; // 작은 값을 앞으로 옮김
            sort3[j] = temp; // 임시변수에 넣어둔 것을 뒤로 옮김

            temp = sort4[i]; // 큰 값을 잠시 임시변수에 저장
            sort4[i] = sort4[j]; // 작은 값을 앞으로 옮김
            sort4[j] = temp; // 임시변수에 넣어둔 것을 뒤로 옮김
        }
    }
  }

  return [sort, sort2, sort3, sort4]
}

